import React from "react";

import "./Discover.css";
const Discover = () => {
  return (
    <section>
      <table>
        <th>Author</th>
        <th>ISBN</th>
      </table>
      <tbody>
        <tr>
          <td>Author: Robert Tineo Castro</td>
          <td>Book</td>
        </tr>
      </tbody>
    </section>
  );
};

export default Discover;
